import "./styles.css"

const buttonA = <button>Histórico</button>
const buttonB = <button>Cadastrar</button>

const hasCostumer = false;


const App = () => {
    
    
    return (
        <div>
        <p>Digital Inovation One</p>
        <p>Hello World</p>
        
        <br />
        {hasCostumer ?(
            <div>
            Veja o histórico<br/>
            {buttonA}
            </div>
            
            ) :(
                <div>
                Cadastre-se <br/> {buttonB}
                </div>
                )}
                
                </div>
                );
            };
            


export default App;
